// specify popup options 
var customOptions =
    {
    'maxWidth': '500',
    'className' : 'custom'
    }



function onEachFeature(feature, layer) {

    layer.bindPopup(feature.properties.NBR2_NBRH, customOptions);
    switch (feature.properties.NBR2_NBRH) {
        case 'Westville': return layer.setStyle({fillColor: 'yellow'})
        case 'Amity': return layer.setStyle({fillColor: 'blue'})
        case 'West Rock': return layer.setStyle({fillColor: 'aqua'})
        case 'Beaver Hills': return layer.setStyle({fillColor: 'red'})
        case 'Edgewood': return layer.setStyle({fillColor: 'hotpink'})
        case 'West River': return layer.setStyle({fillColor: 'lime'})
        case 'Newhallville': return layer.setStyle({fillColor: 'lime'})
        case 'Dixwell': return layer.setStyle({fillColor: 'yellow'})
        case 'Dwight': return layer.setStyle({fillColor: 'blue'})
        case 'Hill': return layer.setStyle({fillColor: 'aqua'})
        case 'Prospect Hill': return layer.setStyle({fillColor: 'aqua'})
        case 'Downtown': return layer.setStyle({fillColor: 'fuchsia'})
        case 'Long Wharf': return layer.setStyle({fillColor: 'yellow'})
        case 'Fair Haven': return layer.setStyle({fillColor: 'blue'})
        case 'Fair Haven Heights': return layer.setStyle({fillColor: 'yellow'})
        case 'Wooster Sq/Mill River': return layer.setStyle({fillColor: 'lime'})
        case 'Annex': return layer.setStyle({fillColor: 'aqua'})
        case 'East Rock': return layer.setStyle({fillColor: 'red'})
        case 'Quinnipiac Meadows':return layer.setStyle({fillColor: 'lime'})
        case 'East Shore': return layer.setStyle({fillColor: 'lime'})
    }

}

L.geoJson(geojsonNeighborhoods, {
    onEachFeature: onEachFeature
}).addTo(map);

